import React from "react";

export const ContactPicker = ({
  contacts,
  onChange,
  value,
  name,
}) => {
  return (
    <>
      <select name="language" id="language" onChange={onChange} value={value}>
        {contacts.map((contact) => {
          return (
            <option name></option>
          )
        })}

        <option value="javascript">JavaScript</option>
        
      </select>
    </>
  );
};
